import React from 'react';
import logo from '../images/logo.png'
import NavbarStyle from './componentStyles/NavbarStyle.module.css';
import '../../src/font/BasierCircle'
function Navbar() {
    return (
        <nav className={NavbarStyle.navbar}>
            <div className={NavbarStyle.navLinksContainer}>
                <div className={NavbarStyle.container1}>
                    <img className={NavbarStyle.logo } src={logo} alt="logo" />
                </div>
                <div className={NavbarStyle.container2}>

                </div>
            </div>
        </nav>
    )
}
export default Navbar;
